window.bookSummaryJSON = "<p><i>Hardcore Self Help: F--k Anxiety</i> is for those of us who find the prospect of reading a traditional self-help book to be way too boring. How are you supposed to make positive changes in your life if the book itself feels like a chore? This audiobook is definitely not a chore. </p> <p>In <i>Hardcore Self Help: F--k Anxiety</i>, I talk to you like a friend. There is lots of swearing and humor but also loads of helpful and actionable information. You learn about anxiety and how to find the weapons within yourself to slay it for good. </p> <p>The audiobook is performed and recorded by me, so you get every intended inflection! </p>"; 
